      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Event and Country Statistics\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"List of World Championships\" src=\"ref://775eb49566\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Countries competing at World Championships\" src=\"ref://028fd85e7c\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Athletes competing at World Championships\" src=\"ref://1a44a3b399\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"20 Largest Total Team size at World Championships\" src=\"ref://a2eb27b35f\"/\u003e\u003cGroup label=\"2023 Registration Stats\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://6ae0beb433\" caption=\"Team Sizes\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://ab992f35b6\" caption=\"Number of Athletes by Discipline and Gender\"/\u003e\u003c/Group\u003e\u003cGroup label=\"2023 Debutants Stats\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://645777c09b\" caption=\"First Senior World Event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://4434743020\" caption=\"First Senior World Event\"/\u003e\u003c/Group\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### Terminology  \n- An event is a set of competitions taking place at a single Venue over a continuous period.  \n- but in 2014 when the Wchamps were split, if you attended both, then it only counts as 1 wchamps.\n- A competition is for a single discipline for a gender (e.g Boulder female), multiple competitions take place at a single event.  \n\n### Highlights  \n- The most countries ever at a World Champs was 55 in 2011 and 2012, this year with 54 countries is a big increase on 2019 and 2021  \n- The most countries to compete in bouldering and Lead is 51 in 2012 and 2011 respectfully  \n- The most countries to compete in Speed is 38 in 2016  \n- Russia has sent the largest teams to a Wchamps, the largest was 35 in 2018  \n\n- This year is the first time that JPN and USA have the largest teams at a Wchamps both with a squad of 21 athletes  \n\n### Event stuff  \n- 3rd time in Switzerland, only France has hosted more with 4 WChamps, first time in Bern  \n- 18th Wchamps (counting 2014 as one wchamps which was spread over 2 events)]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"World Chamionship Competition and Athlete Participation Statistics\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Number of Boulder World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://1560365446\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://3f982c7af8\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Lead World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://7cc14a9a00\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://c604aa29e7\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Speed World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://ae80661589\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://fcbd0bc600\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Combined World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://eb922a3e92\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://ee8e5e3376\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of World Champs all disciplines attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://626cf055fc\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://4c54a92209\"/\u003e\u003c/Group\u003e\u003cText label=\"Highlights\"\u003e\u003c![CDATA[### Boulder  \n- Jain and Petra will be at their 8th Wchamps, 1 behind Akiyo  \n- Jernej and Sean will be at their 9th Wchamps, they hold the joint record  \n\n### Lead  \n- Jain will take the record with her 10th Wchamps in Lead  \n- Jakob and Sean will be at their 9th Wchamps, but the record is 10 Wchamps  \n\n### Speed  \n- Ola will be at her 7th Wchamps, but the record is 9 for women  \n- Marcin DZIENSKI will tie the male record at his 8th Wchamps  \n- Danyil BOLDYREV will tie the male record at his 8th Wchamps  \n\n### Total number of Comps at Wchamps\n- Jain Kim clear leader this will be her 23rd (B), 24th (L) and 25th (B\u0026L) comps at Wchamps\n- Sean McColl clear leader this will be his 28th (B), 29th (L) and 30th (B\u0026L) comps at Wchamps]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Country Results World Champs\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Boulder\" src=\"ref://2e73cccedb\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Lead\" src=\"ref://d12c2be9d4\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Speed\" src=\"ref://f494a9e673\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Combined\" src=\"ref://7996e48227\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for BoulderLead\" src=\"ref://49409464ae\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for All disciplines\" src=\"ref://470602df29\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Boulder\" src=\"ref://d483b17cb7\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Lead\" src=\"ref://dd4744318d\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Speed\" src=\"ref://0e316cd6c6\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Combined\" src=\"ref://2bf91b30bb\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums all disciplines\" src=\"ref://fd67fd30cb\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Country best finishes by gender and discipline\" src=\"ref://44566eaff6\"/\u003e\u003cText label=\"Highlights\"\u003e\u003c![CDATA[### Medal sets (a set is a medal in boulder,lead,speed for both genders)  \n- No country has a complete gold set of Medals, france is closest with 4, they need female boulder and speed to complete the set, Russia also has 4, they need male and female lead  \n- France has a male half-set of golds  \n- Italy has a female half-set of Golds  \n- USA are probably closest to getting a half-set, they need a female speed gold to complete a female set  \n\n- France is the only country to have a complete set of 6 podiums  \n- Italy have 5 podiums, they need a female speed podium to complete the set  \n- several countries have 4 podiums and have a chance of getting to 5  \n\n### Countries Medal League  \n-  Indonesia don\u0027t have any speed medals, surely that will change, they could leap up the Speed medal table  \n-  Unlikely the top spot on any of the country medal tables will change, but there will be movement within the top 5]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Country Results World Champs per Year\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for All disciplines per World Championship\" src=\"ref://de02096f8c\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Boulder\" src=\"ref://65b992666f\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Lead\" src=\"ref://d55f6eaaf9\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Speed\" src=\"ref://febe1a685a\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Combined\" src=\"ref://c8d94d3098\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for BoulderLead\" src=\"ref://3d7e495aea\"/\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Youngest and Oldest Stats\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[**Please treat the finalist and attendee data with caution as there are many athletes without a DoB**  \n    Phrase in a way that says we know of people who were atleast xx years old but we don\u0027t have a definitive youngest/oldest person  \n    Winner and Podium data is nearly 100% complete, so small chance of an error\n\nYoungest]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://d54484fce7\" caption=\"results including 2023 World Champs\"/\u003e\u003cText\u003e\u003c![CDATA[Oldest]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://37b02a5de5\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Athlete Results\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"World Championship Boulder wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://fb0d29584b\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://d8ae7c3721\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Lead wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://b04620a15c\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://6b48ebba81\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Speed wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://78b502567c\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://ffb8336d92\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Combined wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://9de1d003cc\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://9cc3a2cca1\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship all disciplines wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://04bea56aaa\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://b6fc72112f\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Boulder podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://a7429657e9\" caption=\"Boulder\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Lead podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://246098f02c\" caption=\"Boulder\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Speed podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://2d25e24cef\" caption=\"Speed\"/\u003e\u003c/Group\u003e\u003cText\u003e\u003c![CDATA[### Country  \n- No medals for Indonesia, they must have a good chance in speed  \n\n### Female  \n- Janja has most golds across all disciplines (6)  \n- Janja and Akiyo tied on 7 medals  \n\n**Boulder** \n- Janja could overtake Anna Stohr and have the most golds in Bouldering if she wins (3)  \n- Natalia could get a 2nd boulding gold and match Anna and Janja  \n\n**Lead**  \n- Janja could take a 3rd lead Gold, but would still be behind Angela Eiter (4)  \n- Jain, Chaehyun and Jessie all have a chance to win a 2nd Gold and match Janja  \n\n**Speed**  \n- Ola could win a 3rd Gold and match the female reorc in Speed of Olena  \n- Natalia K could win a 2nd Gold and match Ola  \n- Everyone else would be a new winner  \n\n### Male  \n- Adam, Jakob and Qixin tied on most Golds across all disciplines (4), chances for Jakob and Adam to set a new record  \n- Adam has the most medals with 11  \n\n**Boulder** \n- Tomoa could equal Dimittri record of 3 Golds in Bouldering  \n- Adam or Kokoro could match Tomoa if they can win a 2nd bouldering Gold  \n\n**Lead**  \n- Adam and Jakob both have 3 lead Golds, Adam 10 podiums, and Jakob 9 (top 2 males in history)  \n- Apart from the above, anyone else would be a 1st time winner. Alex Megos needs gold to complete the set  \n\n**Speed**  \n- Most likely a new winner, but a couple of previous winners are still competing  \n- Danyil (UKR) could win a 3rd Gold  \n- Ludovico, Reza and Marcin could win a 2nd Gold]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"775eb49566": {"src": "data:application/vnd.datapane.table+html;base64,PHN0eWxlIHR5cGU9InRleHQvY3NzIj4KI1RfYmMwMzlfICB7CiAgYm9yZGVyOiAycHggc29saWQgYmxhY2s7Cn0KPC9zdHlsZT4KPHRhYmxlIGlkPSJUX2JjMDM5XyI+CiAgPHRoZWFkPgogICAgPHRyPgogICAgICA8dGggY2xhc3M9ImNvbF9oZWFkaW5nIGxldmVsMCBjb2wwIiA+Q291bnRyeTwvdGg+CiAgICAgIDx0aCBjbGFzcz0iY29sX2hlYWRpbmcgbGV2ZWwwIGNvbDEiID5FdmVudE5hbWU8L3RoPgogICAgICA8dGggY2xhc3M9ImNvbF9oZWFkaW5nIGxldmVsMCBjb2wyIiA+U3RhcnQ8L3RoPgogICAgICA8dGggY2xhc3M9ImNvbF9oZWFkaW5nIGxldmVsMCBjb2wzIiA+RmluaXNoPC90aD4KICAgICAgPHRoIGNsYXNzPSJjb2xfaGVhZGluZyBsZXZlbDAgY29sNCIgPlZlbnVlPC90aD4KICAgICAgPHRoIGNsYXNzPSJjb2xfaGVhZGluZyBsZXZlbDAgY29sNSIgPk51bUNvbXBzPC90aD4KICAgIDwvdHI+CiAgPC90aGVhZD4KICA8dGJvZHk+CiAgICA8dHI+CiAgICAgIDx0ZCBpZD0iVF9iYzAzOV9yb3cwX2NvbDAiIGNsYXNzPSJkYXRhIHJvdzAgY29sMCIgPkdlcm1hbnk8L3RkPgogICAgICA8dGQgaWQ9IlRfYmMwMzlfcm93MF9jb2wxIiBjbGFzcz0iZGF0YSByb3cwIGNvbDEiID5XQ2hhbXAgMTk5MSBBbGw8L3RkPgogICAgICA8dGQgaWQ9IlRfYmMwMzlfcm93MF9jb2wyIiBjbGFzcz0iZGF0YSByb3cwIGNvbDIiID4xOTkxLTEwLTAyPC90ZD4KICAgICAgPHRkIGlkPSJUX2JjMDM5X3JvdzBfY29sMyIgY2xhc3M9ImRhdGEgcm93MCBjb2wzIiA+MTk5MS0xMC0wMjwvdGQ+CiAgICAgIDx0ZCBpZD0iVF9iYzAzOV9yb3cwX2NvbDQiIGNsYXNzPSJkYXRhIHJvdzAgY29sNCIgPkZyYW5rZnVydDwvdGQ+CiAgICAgIDx0ZCBpZD
